import './contact-item.css';


class ContactItem extends Component {

    state = {
        name: "Aboba",
        number: "+38 (098) 22 864 31",
        image: "https://lh3.googleusercontent.com/rt_A6A1p0ATqY1zH8-YhRTt1dezWN6Oy8T2QOXvqST0W2p00n-x8Oxm51cb0OTmZOCzZ25i6yX3w8cfVFGpeww6CJ6KAdelpXbDjJ7f2aeca-6qMQwljj5cnSuIKvjBwlcABBdaOZD3qYQt68Z-bxApFaD9uMbIG1iXT-1zjbbOlKVoIPbGQcT69WY8ZDjLL2oDYa8zDEyfy19eNCMIG5ICZF4SEQr2guUVRvse-ShyPOQ4sIpIps02dmqCnelGIX83Cwh0DPKRxX0cDa-YJbz1U4HK8YdMo1yjSuWbw-DWxxn1zvqYAORALEW7q1tb_TvFyiJH1geUs8rkGO1hq6_1LOhV2CINBfzA92CIIWQDKBSNKEjlA4g-7PK14HQurX1TTw49yfHfYnuvqJODwnL-6rsxG0btc8qBtWUltTiwoVThgYQWqcsDYyVcMMJSt7lI8H4SJrZX0HjkB39Bp5AlOsq5WirSKUPIAHnUubG_kGvJKwizIaQUWMzKukcES8bCJjVuwTAAI2YxKQ9gWptZVWYJM8vWSFCZ6_5ZsJuGvrUIJA151zrGwOJlg3R0Hj6ydqJeu4qsfor5cYzmUd-UAynq6XdqwaSzvlxYrwetimJklQ86Egywwas1Bgic973g2QRyHeSsMhdFpgKN2rWbq9yToUz-MOVKiMAi77rRlB09J1gahfD260TjkpHuf1JDYuupcFiJ3ChUtM8AT9zrKeQ=w162-h174-no?authuser=0"
